import React, {Component} from 'react';
import {connect} from 'react-redux';
import * as actions from '../../actions';
import "./Dashboard.scss";
import {Link} from "react-router-dom";
import LoadingOverlay from 'react-loading-overlay';

import {
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    InputGroup,
    InputGroupAddon,
    InputGroupText,
    FormInput,
    Collapse
} from "shards-react";

class Dashboard extends Component {
    state = {
        userName: "",
        userPassword: "",
        rememberMe: false,
        loading: false
    };


    componentWillMount() {
    }

    componentDidMount() {

    }


    render() {
        const {logginFailed, loggedIn, errorMessage} = this.state;

        return (
            <LoadingOverlay
                active={this.state.loading}
                spinner
                text='Logging In'
            >
                <div className="dashbaord-page-container">
                    <Navbar type="dark" theme="primary" expand="md">
                        <NavbarBrand href="#">NAPA Panel</NavbarBrand>

                        <Collapse open={this.state.collapseOpen} navbar>
                            <Nav navbar>
                                <NavItem>
                                    <NavLink active href="#">
                                        Active
                                    </NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink href="#" disabled>
                                        Disabled
                                    </NavLink>
                                </NavItem>

                            </Nav>

                            <Nav  className="ml-auto">
                                <NavItem>
                                    <NavLink active href="#" onClick={() => {
                                        this.props.history.push("/admin/login");
                                    }}>
                                        Logout
                                    </NavLink>
                                </NavItem>
                            </Nav>
                        </Collapse>
                    </Navbar>

                    <table className={"table-view"}>
                        <tr>
                            <th>No.</th>
                            <th>Full Name</th>
                            <th>Email</th>
                            <th>Store Number</th>
                            <th>Servicing DC</th>
                            <th>Store Name</th>
                            <th>Store Address</th>
                            <th>Options</th>
                        </tr>
                        <tbody>
                        <tr>
                            <td>1</td>
                            <td>Test User</td>
                            <td>test.one@gmail.com</td>
                            <td>11212</td>
                            <td>test dc</td>
                            <td>Test Store</td>
                            <td>Test Address</td>
                            <td>

                            </td>
                        </tr>
                        </tbody>
                    </table>
                </div>
            </LoadingOverlay>

        );
    }
}

const mapStateToProps = (state) => {
    return {};
}

export default connect(mapStateToProps)(Dashboard);
